## Importing and Preparing Forest Fire data

Next, we will import the forest fire data set (i.e. *forestfires.csv*) into R environment.


::: {.cell}

```{.r .cell-code}
ff <- read_csv("data/rawdata/forestfires.csv") %>%
  st_as_sf(coords = c("longitude", "latitude"),
                       crs = 4326) %>%
  st_transform(crs = 32748)
```
:::


Because **ppp** object only accept numerical or character as mark. The code chunk below is used to convert data type of *acq_date* to numeric.


::: {.cell}

```{.r .cell-code}
ff <- ff %>% 
  mutate(DayofYear = yday(acq_date)) %>%
  mutate(Month_num = month(acq_date)) %>%
  mutate(Month_fac = month(acq_date, 
                           label = TRUE, 
                           abbr = FALSE))
```
:::

::: {.cell}

```{.r .cell-code}
tm_shape(kbb)+
  tm_polygons() +
tm_shape(ff) +
  tm_dots()
```

::: {.cell-output-display}
![](In-class_Ex04_stpp_files/figure-html/unnamed-chunk-8-1.png){width=672}
:::
:::

::: {.cell}

```{.r .cell-code}
tm_shape(kbb)+
  tm_polygons() +
tm_shape(ff) +
  tm_dots(size = 0.1) +
tm_facets(by="Month_fac", 
            free.coords=FALSE, 
            drop.units = TRUE)
```

::: {.cell-output-display}
![](In-class_Ex04_stpp_files/figure-html/unnamed-chunk-9-1.png){width=672}
:::
:::

::: {.cell}

```{.r .cell-code}
ff_month <- ff %>% 
  select(Month_num)
```
:::


The code chunk below is used to remove the unwanted fields from *origin_am* sf data.frame. This is because `as.ppp()` only need the mark field and geometry field from the input sf data.frame.

### Creating ppp

The code chunk below is used to derive a **ppp** object called *origin_am_ppp* from *origin_am sf* data.frame.


::: {.cell}

```{.r .cell-code}
ff_month_ppp <- as.ppp(ff_month)
ff_month_ppp
```

